import Link from 'next/link'
import { Button } from 'reactstrap'
import Layout from '../components/layout'
import Particles from 'react-particles-js'


const particleOpt = {
  particles: {
    number: {
      value: 80,
      density: {
        enable: true,
        value_area: 800
      },
      move: {
        enable: true,
        speed: 6
      }
    }
  },
  interactivity: {
    events: {
        onhover: {
            enable: true,
            mode: ["bubble"]
        }
    }
  }
}

function Index(props) {
    return (
      <div>
        <Particles canvasClassName="particle-canvas" params={particleOpt} />
        <Layout>
          <h1 className="display-3 text-center hello">Hello, I'm Maicon Esteves.</h1>
          <h2 className="display-3 text-center hello">I'm a full-stack developer.</h2>
          <p className="lead center">
            <Button color="primary">Learn More</Button>
          </p>
        </Layout>



      </div>
    );
}

export default Index
